/*
 * @Author: your name
 * @Date: 2021-11-02 14:29:58
 * @LastEditTime: 2022-03-19 20:38:55
 * @LastEditors: Please set LastEditors
 * @Description: 打开koroFileHeader查看配置 进行设置: https://github.com/OBKoro1/koro1FileHeader/wiki/%E9%85%8D%E7%BD%AE
 * @FilePath: \bl-device-manage\src\routes\BasicRouter\configs.js
 */
import React from 'react';
import LoadingComponent from 'Components/ComponentLoading';
import Loadable from 'react-loadable';


// 首页
const DefinePage = Loadable({
  loader: () => import('layouts/BasicManage/DefinePage'),
  loading: LoadingComponent
});
// 系统管理
const ConfigPage = Loadable({
  loader: () => import('layouts/BasicManage/ConfigPage'),
  loading: LoadingComponent
});
// 统计分析
const MessagePage = Loadable({
  loader: () => import('layouts/BasicManage/MessagePage'),
  loading: LoadingComponent
});
// 
const MaintainPage = Loadable({
  loader: () => import('layouts/BasicManage/MaintainPage'),
  loading: LoadingComponent
});

const TitleConfigPage = Loadable({
  loader:() => import('layouts/BasicManage/TitleConfigPage'),
  loading: LoadingComponent
})

export {
  DefinePage,
  ConfigPage,
  MessagePage,MaintainPage,
  TitleConfigPage
};
